  return (

    <Card style={{ width: '18rem' ,marginLeft:'40px'}} >
    <Card.Img variant="top" src="logo512.png" style={{ width: '100%', height:'200px' }} alt='hh' />
    <Card.Body>
      <Card.Title>Card Title</Card.Title>
      <Card.Text>
       <p>اسم الفيلم :</p>
       <p>تاريخ الاصدار :</p>
       <p>نوع الفيلم :</p>

      </Card.Text>
    </Card.Body>
   
    
  </Card>

  )
}

export default CardMovie
